  - {url: 'https://api.youraccessone.com/', description: Production}
paths:
  /North/GetStatusByMPAID:
    post:
      tags:
        - Boarding North API North Common
      x-child-product-name: Boarding
      x-group-name: North Common
      x-proxy-name: Get Status By MPA ID
      summary: Get MPA status by ID.
      requestBody:
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/AO.Boarding.Api.Yamls.RequestParameters.North.GetStatusByMpaIdParameter'
            example:
              mpaId: 0
              extRefID: string
          application/xml:
            schema:
              $ref: '#/components/schemas/AO.Boarding.Api.Yamls.RequestParameters.North.GetStatusByMpaIdParameter'
            example: "<GetStatusByMPAID>\r\n  <mpaId>0</mpaId>\r\n  <extRefID>string</extRefID>\r\n</GetStatusByMPAID>"
      responses:
        '200':
          description: OK
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/AS.Boarding.Common.API.Domain.Models.GetStatusByMPAIDResult'
              examples:
                Successful:
                  value:
                    MPAID: xxxxxx
                    FDMerchantNumber: ''
                    ExtRefID: xxx
                    MPAStatus: Boarded 4/01/2025 04:18:01 PM
                    Status:
                      - OmahaNumber: ''
                        NorthNumber: xxxxxxxxxx
                        CloverID: ''
                        LocationNumber: '1'
                        DBAName: MMIS DBAName
                        CardnetNumber: ''
                        MerchantStatus:
                          - Code: MpaKey
                            Information: Submitted
                            Timestamp: '2025-04-03T10:23:22.0000000-05:00'
                          - Code: ClientApproval
                            Information: Direct Send
                            Timestamp: '2025-04-03T10:23:22.0000000-05:00'
                Invalid Ext Ref ID:
                  value:
                    Status:
                      - MerchantStatus:
                          - Information: Invalid Ext Ref ID.
                            Timestamp: '2025-04-03T10:23:22.0000000-05:00'
                Record Not Found:
                  value:
                    Status:
                      - MerchantStatus:
                          - Information: No record found against the specified mpaid.
                            Timestamp: '2025-04-03T10:23:22.0000000-05:00'
                ' Generic':
                  value:
                    traceId: 7419b838-5dfd-4ae9-ae4b-a0ac35bf28b0
