                    status: Unauthorized
                    timestamp: '2025-09-15T09:35:37.0000000-05:00'
                    messages: [ ]
            application/xml:
              schema:
                $ref: '#/components/schemas/AS.Boarding.Common.API.Domain.Models.GetStatusByMPAIDResult'
              examples:
                Successful:
                  value: "<GetStatusByMPAIDResult>\r\n  <MPAID>xxxxxx</MPAID>\r\n  <FDMerchantNumber></FDMerchantNumber>\r\n  <ExtRefID>xxx</ExtRefID>\r\n  <MPAStatus>Boarded 4/01/2025 04:18:01 PM</MPAStatus>\r\n  <Status>\r\n    <MerchantDetails>\r\n      <OmahaNumber></OmahaNumber>\r\n      <NorthNumber>xxxxxxxxxx</NorthNumber>\r\n      <CloverID></CloverID>\r\n      <LocationNumber>1</LocationNumber>\r\n      <DBAName>MMIS DBAName</DBAName>\r\n      <CardnetNumber></CardnetNumber>\r\n      <MerchantStatus>\r\n        <AppStatus>\r\n          <Code>MpaKey</Code>\r\n          <Information>Submitted</Information>\r\n          <Timestamp>04/03/2025 10:23:22 AM</Timestamp>\r\n        </AppStatus>\r\n        <AppStatus>\r\n          <Code>ClientApproval</Code>\r\n          <Information>Direct Send</Information>\r\n          <Timestamp>04/03/2025 10:23:22 AM</Timestamp>\r\n        </AppStatus>\r\n      </MerchantStatus>\r\n    </MerchantDetails>\r\n  </Status>\r\n</GetStatusByMPAIDResult>"
