                Successful:
                  value:
                    GetStatusByTimeSpanResult:
                      - ASRefId: xxxxx
                        FDMerchantNumber: ''
                        Status:
                          - NorthNumber: xxxxxxxxxx
                            CloverID: ''
                            LocationNumber: '1'
                            DBAName: MMIS DBAName
                            CardnetNumber: ''
